import React from 'react'
import 'materialize-css'
import {useRoutes} from './routes'


function App() {
  const routes = useRoutes( isAuthorized = false )
  return (
    <div className="cont">
      <h1>Hello</h1>
      { routes }
    </div>
  )
}

export default App
